import React from "react";
import styled from "styled-components";

import AboutEcImg from "../atoms/AboutEcImg";
const ContentBlock = styled.div`
  width: auto;
  height: auto;
`;
function AboutEcGrowth() {
  return (
    <ContentBlock>
      <AboutEcImg />
      <AboutEcMainText />
      <AboutEcSubText />
    </ContentBlock>
  );
}

export default AboutEcGrowth;
